import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

const heading = {
    color: 'navy',
    textAlign: 'center',
    fontSize: '40px',
    fontFamily: 'Courier New '
  }

function Notes(){
    return(
        <div>
           Tej's Notes App 
           <div>
                    <li>
                        <Link to="/app" style ={heading} onClick ={<Notes/>}>Success! Click to Continue to Application</Link>
                    </li>
                    <Routes>
                        <Route exact path="/app" element = {<Notes/>} />
                    </Routes>

             </div> 
        </div>
    );
}export default Notes;
